import axios from 'axios'
import React, { useState } from 'react'

function Signup() {
    const [data, setData]=useState({})
    const [userName, setUserName] = useState('')
    const [email, setEmail] = useState('')
    const [password, setPassword] = useState(''
    
    )
    const eventHandle=(e)=>{
        setData({...data,[e.target.name]:e.target.value})
    }

    const userNameHandle=(e)=>{
        setUserName(e)
    }

    const emailHandle=(e)=>{
        setEmail(e)
    }

    const passwordHandle=(e)=>{
       setPassword(e)
    }

    const user = {
        name: userName,
        email: email,
        password: password
      };

    const clickHandler=()=>{
       
        axios.post('http://2e8cc01927fc.ngrok.io/user/signup', user)
        .then((response)=>{
            console.log(response)
               
                //  setData('')
            })
            .catch((error)=>{
                console.log(error)
            })
    }
    return (
      <div>
          <div>
        <input type='text' name='name' value={userName} onChange={userNameHandle} placeholder="name" ></input>
        </div>
        <div>
        <input type='text' name='email' value={email} onChange={emailHandle} placeholder="email" ></input>
        </div>
        <div>
        <input type='text' name='password' value={password} onChange={passwordHandle} placeholder="password" ></input>
        </div>
        <button onClick={clickHandler}>ClickIt</button>
      </div>
    );
  }
  
  export default Signup;
